(85, 1, 'NOVE SED NON NOVA', '<em>NOVE SED NON NOVA</em>.<br/>La manière est nouvelle, mais non la matière. Citation que j’ai jamais pu replacer correctement dans une conversation.<br/><br/>\r\n\r\n<em>Tempora mori, tempora mundis recorda</em>.<br/> Voilà. Eh bien ça, par exemple, ça veut absolument rien dire, mais l’effet reste le même, et pourtant j’ai jamais foutu les pieds dans une salle de classe attention !<br/><br/>\r\n\r\n<em>Victoriae mundis et mundis lacrima</em>.<br/> Bon, ça ne veut absolument rien dire, mais je trouve que c’est assez dans le ton.<br/><br/>\r\n\r\n<em>Deus minimi placet</em>.<br/>Seul les dieux décident.<br/><br/>\r\n\r\n<em>Mundi placet et spiritus minima.</em><br/>Ca n\'a aucun sens mais on pourrait très bien imaginer une traduction du type : \"Le roseau plie, mais ne cède... qu\'en cas de pépin\" ce qui ne veut rien dire non plus\r\n', 'La manière est nouvelle, mais non la matière. ', '2021-11-19 08:58:56', NULL, '619b5cba4f94e.jpg');
